import logo from '../../assets/images/logo.jpeg'
import {NavLink} from 'react-router-dom'
import './sideNav.less'



export default function SideNav(props) {
    return(
        <div className="sideNav" > 
        <div className="topLogo" >
        <img src={logo} alt="children uni" />
        </div>
        
        </div>
    )
}
